import React from 'react'
import styles from './About.module.css'

export default function About(props) {
    return(
        <div className={styles.about}>
            <h1>Soy Mary</h1>
            <p></p>
            <img src="" alt="Not Found" />
            <h3>Hola</h3>
        </div>
    )
}
